import styled from 'styled-components';

export const LoginWrapper = styled.div`
	position:absolute;
	top:0;
	left:0;
	bottom:0;
	right:0;
	background-color:#f1f1f1;
	.backHome{
		margin-top:56px;
		margin-left:50px;
		width:100px;
		display: block;
		.logoImg{
			width:100%;
		}
	}
`;

export const HeaderText = styled.p`
	text-align:center;
	span{
		color:#ea6f5a;
	}
`;
